css:
@-moz-document domain("youtube.com") {
  /* Styles for example.com */
  body {
    background-color: rgba(0, 0, 0, 0);
  }

  .container {
    background-color: rgba(255, 255, 255, 0.7);
    padding: 20px;
  }

  .container .text {
    color: #fff;
  }

  .container a {
    color: #ffa500;
  }

  .container a:hover {
    color: #ff0000;
  }
}
